          const debouncedCalculateSend = debounce(() => {
            const value = parseNumber(sendAmountInput.value);
            if (value > 0 && value < 10) {
              showAmountError('Minimum sending amount must be $10.00.', 'send');
              return;
            } else {
              hideAmountError('send');
            }
            if (value > 0) {
              calculateAmount('send').catch(console.error);
            }
          }, 600);

